import React from "react";
import { Link } from "react-router-dom";
import './index2.css'
const Menu = () => {

  return (
    <>
      {/* <a href="/">about</a>
      <a href="/contact">contact</a> */}
      <br />
      <Link className='link'  to="/">about</Link>
      <Link className='link' to="/contact">contact</Link>
    </>
  );
};

export default Menu;
